import React from "react";
import "./About.scss";
import CollapseAbout from "../../composants/CollapseAbout/CollapseAbout";

const About = () => {
  let data = [
    {
      title: "About",
      content: "Lorem ipsum dolor sit amet, consectetur adipiscing ",
    },
    {
      title: "Respect",
      content: "Lorem ipsum dolor sit amet, consectetur adipiscing ",
    },
  ];
  return (
    <div className="About">
      <div className="image_container">
        <img src="../images/image2.png" alt="" />
      </div>
      <div className="collapse_container">
        <CollapseAbout title="Fiabilité"></CollapseAbout>
        <CollapseAbout title="Respect"></CollapseAbout>
        <CollapseAbout title="Service"></CollapseAbout>
        <CollapseAbout title="Sécurité"></CollapseAbout>
      </div>
    </div>
  );
};

export default About;
